import React from "react";

const Home = React.lazy(() => import("./views/Home"));
const Trailer = React.lazy(() => import("./views/Trailer"));
const About = React.lazy(() => import("./views/About"));
const Contact = React.lazy(() => import("./views/Contact"));
const Product = React.lazy(() => import("./views/Product"));
const ProductDetails = React.lazy(() => import("./views/ProductDetails"));
const Blog = React.lazy(() => import("./views/Blog"));
const BlogDetails = React.lazy(() => import("./views/BlogDetails"));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: "/", exact: true, name: "Home", component: Home },
  { path: "/product-details/:id", exact: true, name: "ProductDetails", component: ProductDetails,breadcrumb:true },
  { path: "/product", exact: true, name: "Product", component: Product,breadcrumb:true },
  { path: "/trailer", exact: true, name: "Trailer", component: Trailer,breadcrumb:true },
  { path: "/contact", exact: true, name: "Contact", component: Contact,breadcrumb:true },
  { path: "/about", exact: true, name: "About", component: About,breadcrumb:true },
  { path: "/blog", exact: true, name: "Blog", component: Blog,breadcrumb:true },
  { path: "/blog-details", exact: true, name: "BlogDetails", component: BlogDetails,breadcrumb:true },
];

export default routes;
